function checkOrderStatus(orderId) {
    // Simulating status retrieval from an API or database
    const orderStatuses = {
      "123456": "Processing",
      "789012": "Shipped",
      "345678": "Delivered",
      // Add more order IDs and statuses as needed
    };
  
    const status = orderStatuses[orderId];
  
    if (status) {
      return `Order ID ${orderId} status: ${status}`;
    } else {
      return `Order ID ${orderId} not found or status not available`;
    }
  }
  
